<script>
import Date from './Date.svelte';
import BookingModal from './BookingModal.svelte';
import {apiUrl, currentDate, bookingsList} from '../stores';

let bookingsResponse;
let showBookingModal = false;
let chosenSeat;
let chosenDate;

const State = {
  Available: 0,
  Booked: 1,
  Blocked: 2
}

const fetchBookings = async () => {
  const response = await fetch(`${$apiUrl}/bookings?date=${$currentDate}`, {headers: {'Content-Type': 'application/json'}});
  bookingsResponse = await response.json();
}

const handleBookingModal = (seatId, date) => {
  showBookingModal = true;
  chosenSeat = seatId;
  chosenDate = date;
}

const handleCloseModal = async () => {
  showBookingModal = false;
  await fetchBookings();
}

const getBookingsByDate = (response) => {
  const bookings = response.bookings.find(b => b.date === $currentDate);
  return bookings.seats;
}

const getSeatAvailability = (response, seatId) => {
  const seats = getBookingsByDate(response);
  const seat = seats.find(s => s.id === seatId);
  return seat ? Object.keys(State)[seat.state].toLocaleLowerCase() : 'available';
}

$: $currentDate && fetchBookings();

</script>

